void OLED_DrawImage(u16 x0, u16 y0)
{
    oleddev.select(1);
    OLED_SetWindow(x0, y0, 128, 128);
    for(int i = 0; i < ((128-x0)*(128-y0)); i++)
    {
        OLED_WR_DATA(image[i] & 0xFF);
        OLED_WR_DATA(image[i] >> 8);
    }
    oleddev.select(0);
}

void OLED_DrawGuitar()
{
    oleddev.select(1);
    OLED_SetWindow(0, 40, 127, 127);
    for(uint16_t i = 0; i < 11264; i++)
    {
        OLED_WR_DATA(image[i] & 0xFF);
        OLED_WR_DATA(image[i] >> 8);
    }
    oleddev.select(0);
}